MathJax.Localization.addTranslation("vi","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax s\u1EED d\u1EE5ng c\xE1c ph\xF4ng ch\u1EEF tr\xEAn Web \u0111\u1EC3 v\u1EBD k\xFD hi\u1EC7u to\xE1n h\u1ECDc tr\xEAn trang n\xE0y. Tr\xECnh duy\u1EC7t ph\u1EA3i t\u1EF1 \u0111\u1ED9ng t\u1EA3i v\u1EC1 c\xE1c ph\xF4ng ch\u1EEF n\xE0y; \u0111\u1EC3 l\xE0m cho trang hi\u1EC3n th\u1ECB nhanh h\u01A1n, b\u1EA1n c\xF3 th\u1EC3 c\xE0i \u0111\u1EB7t c\xE1c ph\xF4ng ch\u1EEF to\xE1n h\u1ECDc tr\u1EF1c ti\u1EBFp v\xE0o th\u01B0 m\u1EE5c ph\xF4ng ch\u1EEF c\u1EE7a m\xE1y.",imageFonts:"MathJax s\u1EED d\u1EE5ng c\xE1c ph\xF4ng ch\u1EEF h\xECnh \u1EA3nh c\u1EE7a n\xF3 thay v\xEC c\xE1c ph\xF4ng ch\u1EEF tr\xEAn m\xE1y ho\u1EB7c tr\xEAn Web. C\xE1c bi\u1EC3u th\u1EE9c to\xE1n h\u1ECDc n\xE0y s\u1EBD hi\u1EC3n th\u1ECB ch\u1EADm h\u01A1n b\xECnh th\u01B0\u1EDDng v\xE0 c\xF3 th\u1EC3 in ra \u1EDF \u0111\u1ED9 ph\xE2n gi\u1EA3i th\u1EA5p.",noFonts:"MathJax kh\xF4ng t\xECm th\u1EA5y ph\xF4ng ch\u1EEF \u0111\u1EC3 hi\u1EC3n th\u1ECB to\xE1n h\u1ECDc, v\xE0 c\xE1c ph\xF4ng ch\u1EEF h\xECnh \u1EA3nh kh\xF4ng c\xF3 s\u1EB5n, n\xEAn n\xF3 s\u1EED d\u1EE5ng c\xE1c k\xFD t\u1EF1 Unicode b\xECnh th\u01B0\u1EDDng n\u1EBFu tr\u01B0\u1EDDng h\u1EE3p tr\xECnh duy\u1EC7t c\xF3 kh\u1EA3 n\u0103ng hi\u1EC3n th\u1ECB ch\xFAng. M\u1ED9t s\u1ED1 k\xFD t\u1EF1 s\u1EBD kh\xF4ng hi\u1EC3n th\u1ECB ho\u1EB7c kh\xF4ng hi\u1EC3n th\u1ECB ch\xEDnh x\xE1c.",webFonts:"H\u1EA7u h\u1EBFt c\xE1c tr\xECnh duy\u1EC7t hi\u1EC7n \u0111\u1EA1i cho ph\xE9p t\u1EA3i v\u1EC1 ph\xF4ng ch\u1EEF t\u1EEB trang m\u1EA1ng. Vi\u1EC7c c\u1EADp nh\u1EADt \u0111\u1EBFn m\u1ED9t phi\xEAn b\u1EA3n tr\xECnh duy\u1EC7t m\u1EDBi h\u01A1n (ho\u1EB7c \u0111\u1ED5i qua tr\xECnh duy\u1EC7t kh\xE1c) c\xF3 th\u1EC3 c\u1EA3i thi\u1EC7n ch\u1EA5t l\u01B0\u1EE3ng c\u1EE7a to\xE1n tr\xEAn trang n\xE0y.",fonts:"MathJax c\xF3 th\u1EC3 s\u1EED d\u1EE5ng [c\xE1c ph\xF4ng ch\u1EEF STIX](%1) ho\u1EB7c [c\xE1c ph\xF4ng ch\u1EEF TeX MathJax](%2). H\xE3y t\u1EA3i v\u1EC1 v\xE0 c\xE0i \u0111\u1EB7t m\u1ED9t trong nh\u1EEFng ph\xF4ng ch\u1EEF n\xE0y \u0111\u1EC3 c\u1EA3i thi\u1EC7n kinh nghi\u1EC7m MathJax c\u1EE7a b\u1EA1n.",STIXPage:"Trang n\xE0y \u0111\u01B0\u1EE3c thi\u1EBFt k\u1EBF \u0111\u1EC3 s\u1EED d\u1EE5ng [c\xE1c ph\xF4ng ch\u1EEF STIX](%1). H\xE3y t\u1EA3i v\u1EC1 v\xE0 c\xE0i \u0111\u1EB7t nh\u1EEFng ph\xF4ng ch\u1EEF n\xE0y \u0111\u1EC3 c\u1EA3i thi\u1EC7n kinh nghi\u1EC7m MathJax c\u1EE7a b\u1EA1n.",TeXPage:"Trang n\xE0y \u0111\u01B0\u1EE3c thi\u1EBFt k\u1EBF \u0111\u1EC3 s\u1EED d\u1EE5ng [c\xE1c ph\xF4ng ch\u1EEF TeX MathJax](%1). H\xE3y t\u1EA3i v\u1EC1 v\xE0 c\xE0i \u0111\u1EB7t nh\u1EEFng ph\xF4ng ch\u1EEF n\xE0y \u0111\u1EC3 c\u1EA3i thi\u1EC7n kinh nghi\u1EC7m MathJax c\u1EE7a b\u1EA1n."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/vi/FontWarnings.js");
